/*
3208. 交替组 II
中等
给你一个整数数组 colors 和一个整数 k ，colors表示一个由红色和蓝色瓷砖组成的环，第 i 块瓷砖的颜色为 colors[i] ：

colors[i] == 0 表示第 i 块瓷砖的颜色是 红色 。
colors[i] == 1 表示第 i 块瓷砖的颜色是 蓝色 。
环中连续 k 块瓷砖的颜色如果是 交替 颜色（也就是说除了第一块和最后一块瓷砖以外，中间瓷砖的颜色与它 左边 和 右边 的颜色都不同），那么它被称为一个 交替 组。

请你返回 交替 组的数目。

注意 ，由于 colors 表示一个 环 ，第一块 瓷砖和 最后一块 瓷砖是相邻的。

提示：

3 <= colors.length <= 105
0 <= colors[i] <= 1
3 <= k <= colors.length
*/

#include <iostream>
#include <vector>
#include <queue>

using namespace std;

int numberOfAlternatingGroups(vector<int> &colors, int k)
{
    int n = colors.size(); // 获取颜色数组的长度
    int ans = 0, cnt = 0;  // 初始化答案变量ans和计数器cnt
    for (int i = 0; i < n * 2; i++)
    { // 遍历两倍于颜色数组长度的范围
        if (i > 0 && colors[i % n] == colors[(i - 1) % n])
        {            // 检查当前瓷砖颜色是否与前一块瓷砖颜色相同
            cnt = 0; // 如果相同，则重置计数器cnt
        }
        cnt++;                     // 计数器cnt递增
        ans += i >= n && cnt >= k; // 当遍历到n及以后的位置且cnt大于等于k时，增加答案计数
    }
    return ans; // 返回最终的答案
}

